        borderStyle:'groove',
        marginBotton:'5px',
        padding:'3px',
        textAlign:'left'
    }

   const styleForGoalsHeading = {

       marginBottom:'0px',
       textAlign:'left',
       paddingLeft:'10px'
   }

    return (
       <div>
        <div class="card" style={card}>
        <h4 class="card-title" style={styleForGoalsHeading}><i class="fas fa-bullseye"></i>  Track Goals</h4>
            <div class="card-body">
                <h6 style={Goals}>  <i class="far fa-square"></i>   Eat</h6>
