                <h6 style={Goals}>  <i class="far fa-square"></i>   Excercise</h6>
                <h6 style={Goals}> <i class="fas fa-check-square"></i>   Repeat</h6>

            </div>
        </div>

        </div>


    );
}

export default Goals;
